export default function CharacterList({ characters }) {
  <div>
    {characters.map((character) => {
      return (
        <div key={character.id}>
          <h2>{character.name}</h2>
          <img src={character.image} alt={character.name} />
        </div>
      );
    })}
  </div>;
}
